__NUXT_JSONP__("/drugs/Vitamin_D3_Analogue_ILX23-7553", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"118694-43-2",chebiId:b,chemicalFormula:b,definition:"A vitamin D3 analogue with potential antineoplastic activity.  ILX23-7553 binds to and activates the vitamin D receptor, a cytoplasmic polypeptide expressed in normal vitamin D responsive tissues, but also overexpressed in certain cancers including hepatocellular carcinoma and pancreatic cancer. Mediated through vitamin D receptor, this agent induces cancer cell differentiation, inhibits cancer cell growth and induces apoptosis. In addition, ILX23-7553 may also induce growth arrest and apoptosis independent of vitamin D receptor activation through mechanisms that are not fully elucidated.",fdaUniiCode:"O13QTC8612",identifier:"C1883",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C1934"],synonyms:["1,25-dihydroxy-16-ene-23-yne-cholecalciferol","16-23-D3","9,10-Secocholesta-5,7,10(19),16-tetraen-23-yne-1,3,25-triol, (1alpha,3beta,5Z,7E)-","BXL 353","ILEX 23-7553","ILX 237553","ILX-237553","ILX23-7553","ILX237553","RO 237553","RO-23-7553","RO-237553","RO237553","Ro23-7553",c]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FVitamin_D3_Analogue_ILX23-7553",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("Vitamin_D3_Analogue_ILX23-7553","","Vitamin D3 Analogue ILX23-7553","2021-10-30T13:37:03.403Z")));